	<title>Section.Subject domain of dodecahedrons</title>
	<meta charset="utf-8">
</head>
<body>
    <p>
            <sc_element sys_idtf="concept_dodecahedron">Додекаэдр</sc_element> 
            имеет <sc_element sys_idtf="number">12</sc_element> 
            <sc_element sys_idtf="nrel_face_of_polyhedron">граней</sc_element>, 
            <sc_element sys_idtf="number">20</sc_element> 
            <sc_element sys_idtf="nrel_vertex_of_polyhedron">вершин</sc_element> и 
            <sc_element sys_idtf="number">30</sc_element> 
            <sc_element sys_idtf="nrel_edge">ребер</sc_element>. 
            Его <sc_element sys_idtf="nrel_face_of_polyhedron">грани</sc_element> - 
            <sc_element sys_idtf="concept_right_pentagon">равносторонние пятиугольники</sc_element>, а каждая его 
            <sc_element sys_idtf="nrel_vertex_of_polyhedron">вершина</sc_element> является 
            <sc_element sys_idtf="nrel_vertex_of_polyhedron">вершиной</sc_element> 
            <sc_element sys_idtf="number">трех</sc_element> 
            <sc_element sys_idtf="concept_pentagon">пятиугольников</sc_element>.

    </p>
